Corsair: Pacific Warrior

War Documentary hosted by James Faulkner, published by History Channel broadcasted as part of HC Battle Stations series in 2001 - English narration


Information
------------------------------

With its bent wings and long nose, the Corsair was one of the most distinctive planes of WWII. It was the scourge of Japanese pilots, capable of diving at more than 500 miles per hour. But, surprisingly, it assumed its most familiar role - flying from the decks of U.S. carriers - three years after it was unveiled. Drawing on color archival film, detailed computer re-enactments and interviews with Corsair pilots, BATTLE STATIONS tells the story of this legendary aircraft. Relive its early battles, when it was flown by Marines from bases on the Solomon islands and earned the nickname &quot;whistling death&quot; from the Japanese. See how British aviators finally mastered the art of deck-landing the powerful fighter, and follow the Corsair through the deadly engagements that led up to the end of the war. 

-- Extended interview of Corsair Pilot Henry 'Boo' Bourgeois joined to the film --

